AccountLinkServiceLinkAccessPermission:
  type: string
  nullable: true
  enum:
  - ALL
  - READ_ONLY
  - UNKNOWN
  title: AccountLinkServiceLinkAccessPermission
  description: |
    <div lang="ja">AccountLinkServiceLinkAccessPermissionは、アカウントリンクアクセス権限を表します。</div>
    <div lang="en">AccountLinkServiceLinkAccessPermission displays the account link access permission.</div>
    <dl class=term>
      <dt class="term__item">ALL</dt>
      <dd class="term__desc"><span lang="ja">全ての操作を許可します。</span><span lang="en">Allows all operations.</span></dd>
      <dt class="term__item">READ_ONLY</dt>
      <dd class="term__desc"><span lang="ja">参照のみ許可します。</span><span lang="en">Only references are allowed.</span></dd>
      <dt class="term__item">UNKNOWN</dt>
      <dd class="term__desc"><span lang="ja">未知の値です。</span><span lang="en">Unknown Value</span></dd>
    </dl>
